import "./sideMenu.css"
import {Link, useLocation} from "react-router-dom";
import {useDispatch} from "react-redux";
import {signOut} from "../../redux/authSlice";
import {useState, useRef, useEffect} from "react";

import HomeOutlinedIcon from '@mui/icons-material/HomeOutlined';
import HomeIcon from '@mui/icons-material/Home';
import SearchIcon from '@mui/icons-material/Search';
import ExploreOutlinedIcon from '@mui/icons-material/ExploreOutlined';
import ExploreIcon from '@mui/icons-material/Explore';
import SendTimeExtensionOutlinedIcon from '@mui/icons-material/SendTimeExtensionOutlined';
import SendTimeExtensionIcon from '@mui/icons-material/SendTimeExtension';
import NotificationsActiveOutlinedIcon from '@mui/icons-material/NotificationsActiveOutlined';
import AddBoxOutlinedIcon from '@mui/icons-material/AddBoxOutlined';
import FaceOutlinedIcon from '@mui/icons-material/FaceOutlined';
import DehazeOutlinedIcon from '@mui/icons-material/DehazeOutlined';
import SettingsOutlinedIcon from '@mui/icons-material/SettingsOutlined';
import BookmarkBorderOutlinedIcon from '@mui/icons-material/BookmarkBorderOutlined';

const SideMenu = () => {

    const [selectedMenu, setSelectedMenu] = useState('/')
    const [toggleMore, setToggleMore] = useState(false)

    const dispatch = useDispatch()
    const location = useLocation()
    const ref = useRef()

    useEffect(() => {
        setSelectedMenu(location.pathname)
    },[location])

    useEffect(() => {
        const handleClickOutside = (event) => {
            if (!ref.current.contains(event.target)) {
                setToggleMore(false);
            }
        };
        document.addEventListener("mousedown", handleClickOutside);
    }, [ref]);

    return (
        <div className="side">
            <div className="side-logo">
                <Link to="/">
                    <h3>Coonstagram</h3>
                </Link>
            </div>

            <div className="space">
                <div className="menu-btn container-side">

                    <Link to="/">
                        <button className={selectedMenu === "/" ? "selected" : ""}>
                        <span>
                            {selectedMenu === "/" ? <HomeIcon fontSize="large"/> : <HomeOutlinedIcon fontSize="large"/>}
                        </span>
                            <span>&nbsp;&nbsp;&nbsp;Home</span>
                        </button>
                    </Link>

                    <button>
                        <span><SearchIcon fontSize="large"/></span>
                        <span>&nbsp;&nbsp;&nbsp;Search</span>
                    </button>

                    <Link to="/explore">
                        <button className={selectedMenu === "/explore" ? "selected" : ""}>
                        <span>
                            {selectedMenu === "/explore" ? <ExploreIcon fontSize="large"/> : <ExploreOutlinedIcon fontSize="large"/>}
                        </span>
                            <span>&nbsp;&nbsp;&nbsp;Explore</span>
                        </button>
                    </Link>

                    <Link to="/inbox">
                        <button className={selectedMenu === "/inbox" ? "selected" : ""}>
                        <span>
                            {selectedMenu === "/inbox" ? <SendTimeExtensionIcon fontSize="large"/> : <SendTimeExtensionOutlinedIcon fontSize="large"/>}
                        </span>
                            <span>&nbsp;&nbsp;&nbsp;Messages</span>
                        </button>
                    </Link>

                    <button>
                        <span><NotificationsActiveOutlinedIcon fontSize="large"/></span>
                        <span>&nbsp;&nbsp;&nbsp;Notifications</span>
                    </button>



                    <Link to="/profile">
                        <button>
                            <span><FaceOutlinedIcon fontSize="large"/></span>
                            <span>&nbsp;&nbsp;&nbsp;Profile</span>
                        </button>
                    </Link>

                </div>

                <div ref={ref}>
                    <div className={toggleMore ? "more-menu" : "hide"}>

                        <button className="buttonTop">
                            Settings
                            <SettingsOutlinedIcon/>
                        </button>

                        <button>
                            Saved
                            <BookmarkBorderOutlinedIcon/>
                        </button>

                        <button
                            className="buttonBot"
                            onClick={() => dispatch(signOut())}
                        >
                            Log out
                        </button>
                    </div>

                    <div className="menu-btn more-btn">
                        <button
                            className={toggleMore ? "selected" : ""}
                            onClick={() => setToggleMore(!toggleMore)}
                        >
                            <span><DehazeOutlinedIcon fontSize="large"/></span>
                            <span>&nbsp;&nbsp;&nbsp;More</span>
                        </button>
                    </div>
                </div>
            </div>


        </div>
    )
}

export default SideMenu
